import base64
import imghdr
from PIL import Image
import io

def convert_and_save_image(base64_string, output_file):
    try:
        # Decode Base64 to bytes
        image_data = base64.b64decode(base64_string)
        
        # Determine the image type using imghdr
        image_type = imghdr.what(None, image_data)
        
        if image_type not in ['jpeg', 'png', 'gif']:  # Add more types if needed
            raise ValueError("Unsupported image format")
        
        # Open image using Pillow (PIL)
        image = Image.open(io.BytesIO(image_data))
        
        # Save image to file
        image.save(output_file, format=image_type.upper())
        
        print(f"Image successfully saved as {output_file}")
    
    except Exception as e:
        print(f"Error: {e}")

